description.text:
the closest thing I could make to sensei's divining top. Sadly, I could not make the letters, so it is blank. this should be printable on a printer with high enough resolution, though unfortunately mine is not among those. ill try it and post pics if i can though.
if you (like me) do not have a hi res printer, i have competed a version that should print with fewer supports and better resolution, albeit in 4 different pieces. it is labeled &quot;senseis top detailed(2)&quot;
EDIT: if the top handle from detailed (2) does not fit or print, i would recommend ...detailed_finalish. it cuts the handle in half and prints it vertically, which should make for smoother sides and less danger of slippage. the only difference in assembly is to put it through the hole at the bottom of the main body, rather than the top
